n, en medio del silbido de los proyectiles.\\nlogseq____&gt;\\nlogseq____&gt; Un militar se instaló en una esquina y varios vecinos lo vieron disparar directo al cuerpo. **Edgar Wilfredo Prado Arango** (51), el padre de Sheyla, vivía apenas a media cuadra y vio a un joven que caía herido. Se propuso socorrerlo. [Un testigo vio que salió cubriéndose con una calamina, con la convicción de que solo disparaban perdigones. Error](https://larepublica.pe/sociedad/2022/12/16/ayacucho-mi-papa-solo-salio-a-defender-a-los-heridos-senala-una-menor-que-perdio-a-su-progenitor-en-protestas/). Una bala le llegó por la espalda mientras intentaba brindar auxilio.\\nlogseq____&gt; No participaba en las **protestas.** Era un padre dedicado al transporte. Quiso brindar ayuda y terminó fulminado al frente de su vivienda.\\n\\nHija pide justicia\\nhttps://twitter.com/lalineape/status/1610792190908792834\\nlogseq____&quot;,536870917]],[logseq____&quot;^17logseq____&quot;,[1035,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;^19logseq____&quot;,536870917]],[logseq____&quot;^17logseq____&quot;,[1035,logseq____&quot;^Glogseq____&quot;,591,536870917]],[logseq____&quot;^17logseq____&quot;,[1035,logseq____&quot;^Zlogseq____&quot;,591,536870917]],[logseq____&quot;^17logseq____&quot;,[1035,logseq____&quot;^Xlogseq____&quot;,591,536870917]],[logseq____&quot;^17logseq____&quot;,[1035,logseq____&quot;^Wlogseq____&quot;,591,536870917]],[logseq____&quot;^17logseq____&quot;,[1035,logseq____&quot;^;logseq____&quot;,true,536870917]],[logseq____&quot;^17logseq____&quot;,[1035,logseq____&quot;^Llogseq____&quot;,[],536870917]],[logseq____&quot;^17logseq____&quot;,[1035,logseq____&quot;^1:logseq____&quot;,true,536870917]],[logseq____&quot;^17logseq____&quot;,[1035,logseq____&quot;^logseq____&lt;logseq____&quot;,logseq____&quot;~u63c5cfb9-0399-46d6-9018-ea38ed38b3b4logseq____&quot;,536870917]],[logseq____&quot;^17logseq____&quot;,[1037,logseq____&quot;^Slogseq____&quot;,logseq____&quot;Justifica los [[Asesi seq____&quot;,1070,536870917]],[logseq____&quot;^17logseq____&quot;,[1071,logseq____&quot;^Zlogseq____&quot;,498,536870917]],[logseq____&quot;^17logseq____&quot;,[1071,logseq____&quot;^Xlogseq____&quot;,498,536870917]],[logseq____&quot;^17logseq____&quot;,[1071,logseq____&quot;^Wlogseq____&quot;,498,536870917]],[logseq____&quot;^17logseq____&quot;,[1071,logseq____&quot;^1:logseq____&quot;,true,536870917]],[logseq____&quot;^17logseq____&quot;,[1071,logseq____&quot;^logseq____&lt;logseq____&quot;,logseq____&quot;~u63c5cfba-1ce0-4592-80c8-18a8d15c4b39logseq____&quot;,536870917]],[logseq____&quot;^17logseq____&quot;,[1073,logseq____&quot;^Slogseq____&quot;,logseq____&quot;logseq____&gt; — Con él he almorzado el día 15 de diciembre, a las dos de la tarde. Luego conversamos y [me dijo ya voy a volver](https://larepublica.pe/sociedad/2022/12/18/dina-boluarte-afirma-que-manifestantes-usaron-hondas-con-ladrillos-y-dinamita-protestas-en-peru-policia-nacional-del-peru/).\\nlogseq____&gt;\\nlogseq____&gt; Jhovana es hermana mayor de **Jhon Mendoza Huarancca** (34 años). Almorzaron juntos. Tres horas después recibió una llamada con la noticia trágica. ==Ella acudió al hospital. Le dijeron que no estaba. Insistió. Ingresó. Buscó y allí, en una sala, estaba el cuerpo: “como NN”.==\\nlogseq____&gt; Le contaron a **Jhovana **que su hermano, al promediar las cinco de la tarde, en medio de los disparos, se tiró en una cuneta. [Un militar se acercó, lo vio y le disparó sin más](https://larepublica.pe/politica/actualidad/2022/12/16/dina-boluarte-presidenta-sobre-fallecidos-en-ayacucho-nuevamente-lamentamos-la-muerte-de-peruanos-protestas-marchas-en-peru-pnp-mdga/).\\nlogseq____&gt; **Jhon Mendoza Huarancca** gestionaba con Jhovana una empresa pequeña de **transporte.** Con eso cubría los gastos de dos hermanos menores y se hacía cargo de su madre, una paciente de cáncer terminal. Todo eso antes del disparo en el tórax que acabó con su vida.\\n\\nlogseq____&quot;,536870917]],[logseq____&quot;^17logseq____&quot;,[1073,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;^19logseq____&quot;,536870917]],[logseq____&quot;^17logseq____&quot;,[1073,logseq____&quot;^Glogseq____&quot;,803,536870917]],[logseq____&quot;^17logseq____&quot;,[1073,logseq____&quot;^Zlogseq____&quot;,803,536870917]],[logseq____&quot;^17logseq____&quot;,[1073,logseq____&quot;^Xlogseq____&quot;,803,536870917]],[logseq____&quot;^17logseq____&quot;,[1073,logseq____&quot;^Wlogseq____&quot;,803,536870917]],[logseq____&quot;^17logseq____&quot;,[1073,logseq____&quot;^;logseq____&quot;,true,536870917]],[logseq____&quot;^17logseq____&quot;,[1073,logseq____&quot;^Llogseq____&quot;,[],536870917]],[logseq____&quot;^17logseq____&quot;,[1073,logseq____&quot;^1:logseq____&quot;,true,536870917]],[logseq____&quot;^17logseq____&quot;,[1073,logseq____&quot;^logseq____&lt;logseq____&quot;,logseq____&quot;~u63c5cfba-8fa6-4628-a150-b5a56e7eba81logseq____&quot;,536870917]],[logseq____&quot;^17logseq____&quot;,[1074,logseq____&quot;^Slogseq____&quot;,logseq____&quot;![Sepelio. Familiares dieron el último adiós a Jhon Mendoza Huarancca. Foto: difusión](../assets/T64M2IHTH5G2DH6NLDQHK63VRY_1671741454003_0.jpg)\\n\\nlogseq____&gt; “Con Jhon almorcé el día 15 de diciembre, a las 2:00 p.m. Luego conversamos y me dijo: ‘ya vuelvo’. Tres horas después, me llaman y me dicen que le han disparado. Cuando fui al hospital, me dijeron que no estaba, pero su cuerpo era el NN que habían llevado. Jhon era el segundo de mis cuatro hermanos, con él trabajábamos en una empresa pequeña de transporte. Con eso pagábamos el tratamiento de mi mamá, que tiene cáncer”.\\nlogseq____&gt;\\nlogseq____&gt; — logseq____&lt;citelogseq____&gt;Jhovana Mendoza Huarancca, hermana mayor de Jhon Mendoza Huaranccalogseq____&lt;/citelogseq____&gt;logseq____&quot;,536870917]],[logseq____&quot;^17logseq____&quot;,[1074,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;^19logseq____&quot;,536870917]],[logseq____&quot;^17logseq____&quot;,[1074,logs __&quot;,[1192,logseq____&quot;^logseq____&lt;logseq____&quot;,logseq____&quot;~u63c5cfbc-23d6-43a0-a342-04bbba578375logseq____&quot;,536870918]],[logseq____&quot;^17logseq____&quot;,[1194,logseq____&quot;^Slogseq____&quot;,logseq____&quot;logseq____&gt; Xavier Candamo [...] tenía 30 años y provenía de la selva peruana, de Iquitos. Hijo de una familia de escasos recursos, fue a Chala en busca de un mejor futuro. Era, además, padre de una niña de 6 años. El 19 de diciembre, acudió junto a más de 2 000 mineros a las protestas.\\nlogseq____&gt;\\nlogseq____&gt; [...]En el material visual donde se registraron sus últimos minutos de vida, se le ve corriendo mientras fuerzas de la PNP avanzan hacia él y otros compañeros suyos. En eso se escucha el sonido del estallido de un arma, y Xavier cae al suelo, exánime.\\nlogseq____&gt; -- https://elbuho.pe/2022/12/el-segundo-fallecido-de-arequipa-durante-las-protestas-lo-que-se-sabe-de-xavier-candamo-dasilva/logseq____&quot;,536870918]],[logseq____&quot;^17logseq____&quot;,[1194,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;^19logseq____&quot;,536870918]],[logseq____&quot;^17logseq____&quot;,[1194,logseq____&quot;^Glogseq____&quot;,824,536870918]],[logseq____&quot;^17logseq____&quot;,[1194,logseq____&quot;^Zlogseq____&quot;,824,536870918]],[logseq____&quot;^17logseq____&quot;,[1194,logseq____&quot;^Xlogseq____&quot;,824,536870918]],[logseq____&quot;^17logseq____&quot;,[1194,logseq____&quot;^Wlogseq____&quot;,824,536870918]],[logseq____&quot;^17logseq____&quot;,[1194,logseq____&quot;^1:logseq____&quot;,true,536870918]],[logseq____&quot;^17logseq____&quot;,[1194,logseq____&quot;^logseq____&lt;logseq____&quot;,logseq____&quot;~u63c5cfbc-4b7f-42ab-8376-2955c0292e08logseq____&quot;,536870918]],[logseq____&quot;^17logseq____&quot;,[1196,logseq____&quot;^Slogseq____&quot;,logseq____&quot;logseq____&gt; Yamileth Aroquipa Hancco tenía 17 años cuando un proyectil -que aún medicina forense debe confirmar si se trata de una bala perdida o perdigón- atravesó su vientre y la mató durante las protestas en Juliaca. Ese día, ella había salido con su familia a comprar alimentos cerca al aeropuerto. Los autos, mototaxis o motos ya no transitaban por la zona y caminar era la única manera de llegar a su destino. A dos cuadras de allí, un disparo acabó con los sueños de Yamileth.\\nlogseq____&gt;\\nlogseq____&gt; “Estábamos los cuatro: mi hija de 15 años, su papá, yo y mi Yamileth. Decidí caminar un poco más adelante, a cinco o seis metros. Ella se quedó con su hermanita. En eso, Yamileth le dijo a mi otra hija me duele el estómago, me duele, avanza y se cayó”, narra su madre Dominga.\\nlogseq____&gt; — https://wayka.pe/la-muerte-de-yamileth-17-anos-universitaria-y-voluntaria-animalista-victima-de-la-represion/\\n\\nlogseq____&gt; El padre de Yamilet recuerda que aquel día lo único que hicieron fue salir a comprar alimentos para abastecerse. Tenían días sin poder comprar los víveres debido a que Juliaca acata el paro indefinido desde el 4 de enero, sin tregua alguna. Fue entonces cuando, repentinamente, Yamileth, la joven universitaria de 17 años, comenzó a sentir un dolor en el estómago. Ni ella ni sus seres queridos habían advertido que un proyectil la hirió de manera mortal. Al verla desmayada, la trasladaron a pie a un establecimiento de salud; desafortunadamente, dejó de existir.\\nlogseq____&gt;\\nlogseq____&gt; Dionisio Aroquipa recuerda con amor a su hija. Mientras participa en el funeral colectivo que se desarrolla en Juliaca, explica que Yamileth era su niña, era responsable y humilde. Recuerda que, a pesar de su juventud, ella seguía sus estudios superiores en la Universidad de Aquino Bolivia (Udabol) en Cochabamba. Cursaba el segundo semestre de Psicología y tenía como sueño estudiar dos carreras.\\nlogseq____&gt; — https://larepublica.pe/sociedad/2023/01/11/protestas-en-puno-juliaca-yamilet-nataly-la-universitaria-de-17-anos-que-murio-alcanzada-por-un-proyectil-en-juliaca-lrsd/\\nlogseq____&quo       // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function(l) {
        if (l.search) {
          var q = {};
          l.search.slice(1).split('&').forEach(function(v) {
            var a = v.split('=');
            q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
          });
          if (q.p !== undefined) {
            window.history.replaceState(null, null,
              l.pathname.slice(0, -1) + (q.p || '') +
              (q.q ? ('?' + q.q) : '') +
              l.hash
            );
          }
        }
